package uniqopeator;

public class LogicalOrOperatorEx {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=20;
		int b=30;
		int c=40;
		int d=25;
		
		if ((a>b)||(c<d)) {
			System.out.println("java");
		}
		else if((a<b)||(c>d)) {
			System.out.println("sunny");
		}
	}

}
